  Widget AllComics(){
    return Stack(
      children: <Widget>[
        //List of Container
        Container(
          //Transform x,y and z
          transform: Matrix4.translationValues(0, MediaQuery
              .of(context)
              .size
              .height * 0.06, 1),
          //Set Width and Height

          height: 450,
          child:FutureBuilder<List<dynamic>>(
              future: getAllComics(),
              builder: (BuildContext context, AsyncSnapshot<List<dynamic>> snapshot) {
                print("snapshot.data?.length");
                print(snapshot.data?.length);
                if (snapshot.connectionState == ConnectionState.done){
                  if (snapshot.data != null && snapshot.data?.length!=0) {
                    return Swiper(
                      itemBuilder: (BuildContext context, int index) {
                        return GestureDetector(
                          onTap: () async {
                            //currentReading = index;
                            ProgressDialog.show(context);
                            final url = "files/"+snapshot.data![index]["comicName"]+"/comicPDF";
                            print(url);
                            final BYTE = await loadFirebase(url);
                            final document = await PdfDocument.openData(BYTE!);
                            if (BYTE == null){
                              print("Null");
                              return;
                            }
                            ProgressDialog.hide();
                            Navigator.push(
                              context,
                              MaterialPageRoute(builder: (context) => PDFViewerPage(pdfDocument: document, FileName: snapshot.data![index]["comicName"],)),
                            );
                          },
                          child: Container(
                            height: 300,
                            child: Stack(
                              children: <Widget>[
                                Card(
                                  color: Colors.black,
                                  semanticContainer: true,
                                  clipBehavior: Clip.antiAliasWithSaveLayer,
                                  child:ShaderMask(
                                    shaderCallback: (rect) {
                                      return LinearGradient(
                                        begin: Alignment.topCenter,
                                        end: Alignment.bottomCenter,
                                        colors: [Colors.white, Colors.transparent],
                                      ).createShader(Rect.fromLTRB(0, 0, rect.width, 450.0));
                                    },
                                    blendMode: BlendMode.dstIn,
                                    child:
                                    Container(
                                      decoration: BoxDecoration(
                                        image: DecorationImage(
                                          image: NetworkImage(snapshot.data![index]["coverURL"]),
                                          fit: BoxFit.fitWidth,
                                          alignment: Alignment.topCenter,
